import React from "react";
import { useNavigate, Route, Routes, BrowserRouter } from "react-router-dom";
import Login from "./Login";
import "../index.css";
import heroImg from "../img/hero.webp";

// import SignUp from "./SignUp";

function Landing() {
  const navigate = useNavigate();

  const handleLogin = () => {
    // Function to handle the login button click
    navigate(Login); // Navigate to the "dashboard" route
  };

  const handleSignUp = () => {
    // Function to handle the sign-up button click
    navigate("/signup"); // Navigate to the "signup" route
  };

  return (
    <div className="landing-div">
      <h1>Buy Now!</h1>

      <button onClick={handleLogin}>Login</button>
      <button onClick={handleSignUp}>Don't have an Account? Sign Up</button>
      {/* <Login />
        <SignUp /> */}
    </div>
  );
}

export default Landing;
